var $bm_rt;
var nullLayerNames = [
        'Layer 2/UI_center Outlines: Path 4 [1.1.0]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.1]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.2]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.3]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.4]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.5]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.6]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.7]',
        'Layer 2/UI_center Outlines: Path 4 [1.1.8]'
    ];
var origPath = thisProperty;
var origPoints = origPath.points();
var origInTang = origPath.inTangents();
var origOutTang = origPath.outTangents();
var getNullLayers = [];
for (var i = 0, il = nullLayerNames.length; i < il; i++) {
    try {
        getNullLayers.push(effect(nullLayerNames[i])('ADBE Layer Control-0001'));
    } catch (err) {
        getNullLayers.push(null);
    }
}
for (var i = 0, il = getNullLayers.length; i < il; i++) {
    if (getNullLayers[i] != null && getNullLayers[i].index != thisLayer.index) {
        origPoints[i] = fromCompToSurface(getNullLayers[i].toComp(getNullLayers[i].anchorPoint));
    }
}
$bm_rt = createPath(origPoints, origInTang, origOutTang, origPath.isClosed());

